    [],nt"revision_timestamp": "2016-10-19T17:52:28.116002",nt"name": "cape-kennedy-thunderstorms-data",nt"isopen":
    false,nt"url": null,nt"notes": "Cape Kennedy Thunderstorms Data contains
    an account of all thunderstorms reported in weather observations taken at Cape Kennedy
    Air Force Station, Florida between 1957 and 1972. Elements recorded include date
    and time thunderstorm began and ended, quadrant(s) in which the storm was first
    and last observed, direction of movement, intensity, frequency of thunder, presence
    of more than one storm, lightning characteristics and intensity. Wind speed (sustained
    and gusts), wind shift, pressure tendency, and minimum ceiling hight and visibility
    are also included.",nt"license_title": null,nt"extras": [{ntt"key":
